import { useEffect, useState } from "react";
import { useParams, useNavigate, Link } from "react-router-dom";
import axios from "axios";
import { toast } from "react-toastify";

const DogEditPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [name, setName] = useState('');
  const [breed_group, setBreedGroup] = useState('');
  const [size, setSize] = useState('');
  const [lifespan, setLifeSpan] = useState('');
  const [origin, setOrigin] = useState('');
  const [temperament, setTemperament] = useState('');
  const [colors, setColors] = useState([]);
  const [description, setDescription] = useState('');
  const [image, setImage] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:5555/api/dogs/${id}`, { withCredentials: true });
        setName(response.data.name);
        setBreedGroup(response.data.breed_group);
        setSize(response.data.size);
        setLifeSpan(response.data.lifespan);
        setOrigin(response.data.origin);
        setTemperament(response.data.temperament);
        setColors(response.data.colors);
        setDescription(response.data.description);
        setImage(response.data.image);
      } catch (error) {
        toast.error(error?.data?.message || error.message);
      }
    };

    fetchData();
  }, [id]);

  const submitHandler = async (e) => {
    e.preventDefault();
    try {
      await axios.put(`http://localhost:5555/api/dogs/${id}`, {
        name,
        breed_group,
        size,
        lifespan,
        origin,
        temperament,
        colors,
        description,
        image
      }, { withCredentials: true });
      navigate(`/dashboard/${id}/edit`);
      toast.success('Dog updated successfully');
    } catch (error) {
      toast.error(error?.data?.message || error.message);
    }
  }

  const createUploadHandler = async (e) => {
    const file = e.target.files[0];
    const formData = new FormData();
    formData.append('image', file);

    try {
      const response = await axios.post('http://localhost:5555/api/uploads', formData, { withCredentials: true });
      setImage(response.data.image);
      toast.success('Image uploaded successfully');
    } catch (error) {
      toast.error(error?.data?.message || error.message);
    }
  }

  return (
    <div style={{ display: "flex", justifyContent: "center", alignItems: "center", backgroundColor: "#f7fafc", minHeight: "100vh", padding: "40px 0" }}>
      <div style={{ width: "100%", maxWidth: "800px", padding: "0 16px" }}>
        <h1 style={{ fontSize: "32px", fontWeight: "bold", textAlign: "center", color: "#2c5282", marginBottom: "32px" }}>Edit Dog</h1>
        <div style={{ backgroundColor: "#fff", padding: "32px", borderRadius: "8px", boxShadow: "0 10px 15px rgba(0, 0, 0, 0.1)" }}>
          <form onSubmit={submitHandler}>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Name</label>
              <input
                type="text"
                placeholder="Enter name"
                value={name}
                onChange={(e) => setName(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Breed group</label>
              <input
                type="text"
                placeholder="Enter breed group"
                value={breed_group}
                onChange={(e) => setBreedGroup(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Size</label>
              <input
                type="text"
                placeholder="Enter size"
                value={size}
                onChange={(e) => setSize(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Lifespan</label>
              <input
                type="text"
                placeholder="Enter lifespan"
                value={lifespan}
                onChange={(e) => setLifeSpan(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Origin</label>
              <input
                type="text"
                placeholder="Enter origin"
                value={origin}
                onChange={(e) => setOrigin(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Temperament</label>
              <input
                type="text"
                placeholder="Enter temperament"
                value={temperament}
                onChange={(e) => setTemperament(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Colors</label>
              <input
                type="text"
                placeholder="Enter colors"
                value={colors}
                onChange={(e) => setColors(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }}
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Description</label>
              <textarea
                placeholder="Enter description"
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", resize: "none" }}
                rows="5"
                required
              />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Image</label>
              <input
                type="text"
                value={image}
                onChange={(e) => setImage(e.target.value)}
                disabled
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", backgroundColor: "#edf2f7" }}
              />
              <input
                type="file"
                placeholder="Upload image"
                onChange={createUploadHandler}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", marginTop: "8px" }}
              />
            </div>
            <div style={{ textAlign: "center" }}>
              <button type="submit" style={{ backgroundColor: "#2c5282", width: "100%", color: "#fff", fontWeight: "bold", padding: "12px 24px", borderRadius: "4px", transition: "background-color 0.3s", cursor: "pointer" }}>
                Update
              </button>
              <Link to="/dogs/dashboard" style={{ backgroundColor: "#a0aec0", width: "100%", color: "#fff", fontWeight: "bold", padding: "12px 24px", borderRadius: "4px", transition: "background-color 0.3s", marginTop: "8px", display: "inline-block", textDecoration: "none", textAlign: "center" }}>
                Cancel
              </Link>
            </div>
          </form>
        </div>
      </div>
    </div>
  )
}

export default DogEditPage
